Een aantal internationale huurmoordenaars is gevangen genomen en opgesloten in een hightech bunker die bekend staat als de &quot;Moordkamer&quot;. Om vrij te komen uit deze betonnen hel moeten ze met elkaar duelleren, het opnemen tegen dodelijke ninja's en de strijd aangaan met bendes van gemaskerde maniakken. Wanneer ze dit alles overleven moeten ze het opnemen tegen Snakehead, een gestoorde moordenaar die zich door niemand laat tegenhouden om ze allemaal te vermoorden.



